import React from 'react';
import { Marker } from 'google-maps-react';

class CustomMarker extends Marker {
    render() {
        return (
            <div className="marker"
        style={{ backgroundColor: color, cursor: 'pointer'}}
        title={name}
      />
        )
    }
}

export default CustomMarker;
